import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useSpring, animated } from 'react-spring';

const Biosensing = () => {
    const fadeIn = useSpring({
        from: { opacity: 0 },
        to: { opacity: 1 },
        config: { duration: 1000 }, // Adjust the duration as needed
    });

    return (
        <animated.div className="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column" style={fadeIn}>
      <header className="mb-auto">
        <div>
          <h3 className="float-md-start mb-0">Biosensing Project</h3>
        </div>
      </header>

      <main className="px-3">
        <h1>Biosensing Innovations</h1>
        <p className="lead">
          Explore the cutting-edge biosensing technologies developed in our nanotechnology lab.
        </p>

        <div className="row">
          {/* Card 1 */}
          <div className="col-md-6 mb-4">
            <div className="card h-100">
              <img src="card_image_1.jpg" className="card-img-top smaller-image" alt="Card 1" />
              <div className="card-body">
                <h5 className="card-title bigger-text">Project Aspect 1</h5>
                <p className="card-text bigger-text">
                  Description of the first aspect of the biosensing project.
                </p>
              </div>
            </div>
          </div>

          {/* Card 2 */}
          <div className="col-md-6 mb-4">
            <div className="card h-100">
              <img src="card_image_2.jpg" className="card-img-top smaller-image" alt="Card 2" />
              <div className="card-body">
                <h5 className="card-title bigger-text">Project Aspect 2</h5>
                <p className="card-text bigger-text">
                  Description of the second aspect of the biosensing project.
                </p>
              </div>
            </div>
          </div>

          {/* ... (rest of the cards remain the same) */}
        </div>
      </main>

      <footer className="mt-auto">
        <p>Â© 2024 Your Lab Name</p>
      </footer>
    </animated.div>
    );
};

export default Biosensing;
